import React from 'react';
import './Button.css';

const Banner = () => {
    return (
        <div style={{
            backgroundColor: 'rgba(215, 215, 215, 0.8)',
            color: '#000',
            padding: '10px',
            textAlign: 'center',
            position: 'fixed',
            top: '0',
            width: '100%',
            height: '15px',
            zIndex: '1000',
            backdropFilter: 'blur(5px)',
        }}>
            <button className="styled-button" style={
                {
                    backgroundColor: 'rgba(0, 0, 0, 0)',
                    color: 'black',
                    border: '2px solid black',
                    padding: '10px',
                    fontSize: '16px',
                    cursor: 'pointer',
                }
            }>Search
            </button>
        </div>
    )
};

export default Banner;
